webpackJsonp([0xa88c64fe1155],{415:function(e,o){e.exports={data:{site:{siteMetadata:{title:"MAC0213 Blog",author:"Victor Hugo M. Pinto"}},markdownRemark:{id:"/Users/victorhugo/Projects/mac213-blog/src/pages/26-05/index.md absPath of file >>> MarkdownRemark",html:"<p>Durante a semana dos dias 26/05 à 01/06, trabalhei em alguns ajustes finais nos módulo de <em>back-end</em> e do banco de dados.</p>\n<p>Fiz modificações procurando evitar a cópia de arquivos desnecessários para o container e tentar deixar o processo de <em>build</em> e <em>up</em> mais rápido. Pra isso modifiquei o script de inicialização da API quebrando-o em dois, sendo um deles responsável por compilar o código dos diferentes serviços que compõem o <em>back-end</em> e o outro responsável por subir o servidor da aplicação e inicializar o banco de dados.</p>\n<p>Com essas modificações, o processo de subida da aplicação ficou muito mais rápido, pois o código não seria compilado sempre, e o banco de dados não precisaria ser criado novamente.</p>\n<p>Durante a semana também tive problema com o dump do banco de dados que tinha recebido, que resultavam em erro quando tentava popular o BD. Levei esse problema para o time da SMIT e eles me mandaram um dump mais recente, com esse consegui inicializar o BD.</p>\n<p><strong>Horas</strong>: 8 horas</p>",frontmatter:{title:"Conteinerização (Pt. 6)",date:"June 02, 2019"}}},pathContext:{slug:"/26-05/",previous:{fields:{slug:"/19-05/"},frontmatter:{title:"Conteinerização (Pt. 5)"}},next:{fields:{slug:"/02-06/"},frontmatter:{title:"Conteinerização (Pt. 7)"}}}}}});
